import React,{Component} from "react";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import "./Components/style.css";

class titipanBarang extends Component{
    render(){
        return(
            <div>
                <Header />
                <div className="request-list">
                    <h1>List titipan barang</h1>
                    <form action="list_barang.html" method="POST">
                        <label>Silahkan masukan jumlah barang anda</label><br />
                        <input type="number" name={this.props.jumlah_barang} onChange={this.props.handleChange} />
                        <a onClick={this.props.list_jumlah}>Oke</a>
                    </form>
                    <div id="test" />
                </div>
                <div id="test"></div>
                <Footer />
            </div>
        );
    }
}

export default titipanBarang;
